"use strict";(self.webpackChunklittle_docusaur=self.webpackChunklittle_docusaur||[]).push([[8130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/8-2-2025","metadata":{"permalink":"/blog/8-2-2025","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/8-2-2025.md","source":"@site/blog/8-2-2025.md","title":"N\u1eafng v\xe0ng v\xe0 b\u1ee5i d\xe2y leo","description":"| 7h30 - Th\u1ee9 b\u1ea3y, 8/2/25 - 23\xb0C |","date":"2025-03-04T14:22:46.000Z","tags":[],"readingTime":1.445,"hasTruncateMarker":true,"authors":[{"name":"littleWhale","title":"3rd Information Security student @ UIT","url":"https://github.com/ThienAnUIT2022","socials":{"github":"https://github.com/ThienAnUIT2022","facebook":"https://www.facebook.com/anotherLittleW/","website":"https://thienanuit2022.github.io","email":"22520028@gm.uit.edu.vn"},"imageURL":"https://github.com/ThienAnUIT2022.png","key":"littleWhale","page":null}],"frontMatter":{"sidebar_label":"8-2-2025","sidebar_position":2,"title":"N\u1eafng v\xe0ng v\xe0 b\u1ee5i d\xe2y leo","authors":["littleWhale"]},"unlisted":false,"nextItem":{"title":"T\u1ef1 truy\u1ec7n t\xf4i vi\u1ebft ~","permalink":"/blog/intro"}},"content":"| `7h30 - Th\u1ee9 b\u1ea3y, 8/2/25 - 23\xb0C` |\\n| ------------------------------- |\\n\\n\u0110\xf3 l\xe0 nh\u1eefng th\xf4ng tin tr\xean m\xe0n h\xecnh kh\xf3a \u0111i\u1ec7n tho\u1ea1i. D\u1ea1o n\xe0y bu\u1ed5i s\xe1ng tr\u1eddi se se l\u1ea1nh nh\u01b0ng n\u1eafng v\u1eabn \u0111\u1eb9p, v\xe0ng \u01b0\u01a1m v\xe0 \u1ea5m \xe1p.\\n\\nH\xf4m nay v\u1eabn nh\u01b0 m\u1ecdi ng\xe0y, t\xf4i d\u1eady l\xfac 6h15, \u0111\xe1nh r\u0103ng r\u1eeda m\u1eb7t v\xe0 n\u1ea5u n\u01b0\u1edbc pha m\u1ed9t phin c\xe0 ph\xea, nh\u1ea5p m\u1ed9t ng\u1ee5m r\u1ed3i t\u1eadp th\u1ec3 d\u1ee5c.\\n\\nM\u1ed9t ng\xe0y tr\xe0n \u0111\u1ea7y n\u0103ng l\u01b0\u1ee3ng.\\n\\n\x3c!-- truncate --\x3e\\n\\nNh\xecn v\xe0o ch\xf9m d\xe2y leo tr\u01b0\u1edbc hi\xean nh\xe0, \xe1nh n\u1eafng xu\xe2n \u0111ang ph\u1ee7 l\xean t\u1eebng t\xe1n l\xe1, n\u1ee5 hoa, nh\u01b0 m\u1ed9t l\u1edbp b\u1ee5i ti\xean trong phim c\u1ed5 t\xedch khi\u1ebfn con tim t\xf4i nh\u01b0 v\u1ee1 \xf2a.\\n\\n\u0110\xe2y kh\xf4ng ph\u1ea3i l\u1ea7n \u0111\u1ea7u t\xf4i th\u1ea5y c\u1ea3nh n\xe0y, nh\u01b0ng m\u1ed7i l\u1ea7n nh\xecn t\xf4i l\u1ea1i xu\xfdt xoa \\"C\u1ea3nh n\xe0y m\xe0 l\xe0m phim th\xec \u0111\u1eb9p ph\u1ea3i bi\u1ebft\\". L\u1ea1i nh\u01b0 m\u1ed9t th\xf3i quen, t\xf4i c\u1ea7m \u0111i\u1ec7n tho\u1ea1i l\xean, tho\u0103n tho\u1eaft nh\u01b0 chim ru\u1ed3i t\xecm m\u1eadt, loanh qua loanh quanh b\u1ee5i d\xe2y leo ng\u1eadp n\u1eafng \u0111\u1ec3 t\xecm g\xf3c ch\u1ee5p c\xf3 th\u1ec3 di\u1ec5n t\u1ea3 \u0111\u01b0\u1ee3c v\u1ebb \u0111\u1eb9p th\u01a1 m\u1ed9ng n\xe0y. Nh\u01b0ng m\xe3i v\u1eabn ch\u1eb3ng t\xecm \u0111\u01b0\u1ee3c, b\u1ea5t ch\u1ee3t m\u1ed9t c\u01a1n gi\xf3 b\u1ea5c m\xe1t l\xe0nh th\u1ed5i qua. Nh\xecn th\u1ea5y nh\u1eefng chi\u1ebfc l\u1ed3ng \u0111\xe8n \u0111ung \u0111\u01b0a trong gi\xf3, m\u1ed9t \xfd t\u01b0\u1edfng n\xe3y l\xean trong \u0111\u1ea7u t\xf4i. R\u1eb1ng thay v\xec m\u1ed9t b\u1ee9c \u1ea3nh ch\u1ec9 c\xf3 ch\xf9m d\xe2y leo kia th\xec l\u1ea5y n\xf3 l\xe0m n\u1ec1n v\xe0 t\xe2m \u0111i\u1ec3m l\xe0 chi\u1ebfc l\u1ed3ng \u0111\xe8n.\\n\\n![illustration image](./img/IMG_20250208_085830.jpg)\\n\\n> _\\"\u0110\xf4i khi ta qu\xe1 t\u1eadp trung v\xe0o c\u1ea3nh \u0111\u1eb9p l\xe0m cho b\u1ee9c \u1ea3nh tr\u1edf n\xean \u0111\u01a1n \u0111i\u1ec7u m\xe0 qu\xean m\u1ea5t r\u1eb1ng \u0111\xf3 ch\u1ec9 l\xe0 \\"c\u1ea3nh\\", l\xe0 ph\u1ea7n n\u1ec1n l\xe0m n\u1ed5i b\u1eadt cho m\u1ed9t s\u1ef1 v\u1eadt kh\xe1c. Khi c\u1ea3nh v\xe0 v\u1eadt h\xe0i h\xf2a, m\u1ed9t b\u1ee9c \u1ea3nh \u0111\u1eb9p \u0111\u01b0\u1ee3c ra \u0111\u1eddi\\"._"},{"id":"/intro","metadata":{"permalink":"/blog/intro","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/intro.md","source":"@site/blog/intro.md","title":"T\u1ef1 truy\u1ec7n t\xf4i vi\u1ebft ~","description":"Chao x\xecn, xin ch\xe0o \u30fd(\u30fb\u2200\u30fb)\uff89","date":"2025-03-04T14:22:46.000Z","tags":[],"readingTime":0.755,"hasTruncateMarker":false,"authors":[{"name":"littleWhale","title":"3rd Information Security student @ UIT","url":"https://github.com/ThienAnUIT2022","socials":{"github":"https://github.com/ThienAnUIT2022","facebook":"https://www.facebook.com/anotherLittleW/","website":"https://thienanuit2022.github.io","email":"22520028@gm.uit.edu.vn"},"imageURL":"https://github.com/ThienAnUIT2022.png","key":"littleWhale","page":null}],"frontMatter":{"sidebar_label":"Intro","sidebar_position":1,"authors":["littleWhale"]},"unlisted":false,"prevItem":{"title":"N\u1eafng v\xe0ng v\xe0 b\u1ee5i d\xe2y leo","permalink":"/blog/8-2-2025"}},"content":"**Chao x\xecn, xin ch\xe0o \u30fd(\u30fb\u2200\u30fb)\uff89**\\nM\u1ecdi ng\u01b0\u1eddi h\u1ecdc ch\xe1n g\xf2i \u0111\xfang hong? (\xb4\uff61\u2022 \u03c9 \u2022\uff61`) V\u1eady th\xec th\u01b0 gi\xe3n th\xf4i. M\u1ecdi ng\u01b0\u1eddi c\xf3 hay \u0111\u1ecdc m\u1ea5y c\xe2u chuy\u1ec7n ng\u1eafn hong? T\xf4i \u0111ang \u0111\u1ecbnh vi\u1ebft m\u1ea5y m\u1eabu chuy\u1ec7n ng\u1eafn v\u1ec1 cu\u1ed9c s\u1ed1ng h\xe0ng ng\xe0y c\u1ee7a m\xecnh, c\xf3 th\u1ec3 n\xf3 ch\u1ec9 \u0111\u01a1n gi\u1ea3n l\xe0 c\u1ea3m ngh\u0129 c\u1ee7a t\xf4i v\u1ec1 vi\u1ec7c g\xec \u0111\xf3, ho\u1eb7c s\u1ef1 vi\u1ec7c t\xf4i mu\u1ed1n chia s\u1ebb cho m\u1ecdi ng\u01b0\u1eddi, ho\u1eb7c ch\u1ec9 l\xe0 m\u1ed9t v\xe0i b\u1ee9c h\xecnh \u01b0ng \xfd t\xf4i ch\u1ee5p \u0111\u01b0\u1ee3c trong ng\xe0y th\xf4i ~\\n\\n\xc0 m\xe0 t\xf4i c\u0169ng r\u1ee7 r\xea c\u1eadu \u1ea5y vi\u1ebft t\u1ef1 truy\u1ec7n, nh\u01b0ng m\xe0 c\u1eadu \u1ea5y c\u1ee9 n\xf3i m\xecnh ch\u1eb3ng bi\u1ebft vi\u1ebft g\xec. N\xean l\xe0 series n\xe0y c\xf3 l\u1ebd ch\u1ec9 m\xecnh t\xf4i vi\u1ebft th\xf4i \xe1 ( \u02d9\ua4b3\u200b\u02d9 ), ho\u1eb7c t\xf4i s\u1ebd \xe9p bu\u1ed9c c\u1eadu \u1ea5y vi\u1ebft hehehe (\xac\u203f\xac ).\\n\\nGi\u1edbi thi\u1ec7u c\u0169ng ch\u1ec9 c\xf3 v\u1eady hoi :3 H\u1eb9n g\u1eb7p l\u1ea1i m\u1ecdi ng\u01b0\u1eddi trong th\u1eddi gian t\u1edbi."}]}}')}}]);